import React from 'react';

import NewsSlider from '../widgets/NewsSlider/slider';
import NewsList from '../widgets/NewsList/newsList';
import VideosList from '../widgets/VideosList/videosList';

const Home = () =>{
    return(
        <div>
            <NewsSlider
                type="featured"
                country={'ca'}
                city={''}
                category={'health'}
                amount={5}
                setting={{
                    dots:true
                }}
            />
            <NewsList
                type="detail"
                country={'ca'}
                city={''}
                category={'business'}
                amount={10}
                loadmore={true}
            />
            <VideosList
                type="card"
                query={'Covid+News'}
                order={'relevance'}
                duration={'short'}
                type={'video'}
                defintion={'high'}
                maxResults={'5'}
                title={true}
                loadmore={true}
            />

        </div>
    )
}

export default Home;
